import React, { useState } from 'react';
import axios from 'axios';

function App() {
  // State to hold form data
  const [formData, setFormData] = useState({
    Branch: 'CSE', 
    Year: '1st', 
    Daily_Study_Hours: '', 
    Sleep_Hours: '',
    Weekly_Assignments: '', 
    Backlogs: 0, 
    Screen_Time_Hours: '',
    Stress_Level_1_10: 5, 
    Career_Clarity_1_10: 5, 
    Interested_in_Core_Job: 'Yes'
  });

  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Handle input changes
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Submit form to Backend
  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setResult(null);

    try {
      // Convert string inputs to numbers where needed
      const payload = {
        ...formData,
        Daily_Study_Hours: parseFloat(formData.Daily_Study_Hours),
        Sleep_Hours: parseFloat(formData.Sleep_Hours),
        Weekly_Assignments: parseInt(formData.Weekly_Assignments),
        Backlogs: parseInt(formData.Backlogs),
        Screen_Time_Hours: parseFloat(formData.Screen_Time_Hours),
        Stress_Level_1_10: parseInt(formData.Stress_Level_1_10),
        Career_Clarity_1_10: parseInt(formData.Career_Clarity_1_10)
      };

      // CALL THE API
      const response = await axios.post('http://127.0.0.1:8000/predict', payload);
      setResult(response.data);
    } catch (err) {
      console.error("Error:", err);
      setError("Failed to connect to the backend. Is it running?");
    }
    setLoading(false);
  };

  return (
    <div className="min-h-screen bg-gray-100 flex items-center justify-center p-6 font-sans">
      <div className="bg-white shadow-2xl rounded-xl p-8 max-w-2xl w-full">
        <h1 className="text-3xl font-bold text-center mb-2 text-blue-700">Academic Burnout Predictor</h1>
        <p className="text-center text-gray-500 mb-8">Enter your daily habits to assess your risk.</p>

        <form onSubmit={handleSubmit} className="space-y-6">

          {/* Row 1 */}
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div>
              <label className="block text-sm font-medium text-gray-700">Branch</label>
              <select name="Branch" onChange={handleChange} className="w-full mt-1 p-2 border rounded-md focus:ring-2 focus:ring-blue-500">
                <option>CSE</option><option>ECE</option><option>ME</option><option>EEE</option><option>AI & DS</option>
              </select>
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Year</label>
              <select name="Year" onChange={handleChange} className="w-full mt-1 p-2 border rounded-md focus:ring-2 focus:ring-blue-500">
                <option>1st</option><option>2nd</option><option>3rd</option><option>4th</option>
              </select>
            </div>
          </div>

          {/* Row 2 */}
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            <div>
              <label className="block text-sm font-medium text-gray-700">Study Hours (Daily)</label>
              <input type="number" step="0.1" name="Daily_Study_Hours" onChange={handleChange} required className="w-full mt-1 p-2 border rounded-md" placeholder="e.g. 5.5" />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Sleep Hours</label>
              <input type="number" step="0.1" name="Sleep_Hours" onChange={handleChange} required className="w-full mt-1 p-2 border rounded-md" placeholder="e.g. 7.0" />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Screen Time (Hrs)</label>
              <input type="number" step="0.1" name="Screen_Time_Hours" onChange={handleChange} required className="w-full mt-1 p-2 border rounded-md" placeholder="e.g. 4.0" />
            </div>
          </div>

          {/* Row 3 */}
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div>
              <label className="block text-sm font-medium text-gray-700">Stress Level (1-10)</label>
              <input type="number" min="1" max="10" name="Stress_Level_1_10" onChange={handleChange} required className="w-full mt-1 p-2 border rounded-md" placeholder="1 = Low, 10 = High" />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Career Clarity (1-10)</label>
              <input type="number" min="1" max="10" name="Career_Clarity_1_10" onChange={handleChange} required className="w-full mt-1 p-2 border rounded-md" />
            </div>
          </div>

          {/* Row 4 */}
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            <div>
              <label className="block text-sm font-medium text-gray-700">Assignments/Week</label>
              <input type="number" name="Weekly_Assignments" onChange={handleChange} required className="w-full mt-1 p-2 border rounded-md" />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Backlogs</label>
              <input type="number" name="Backlogs" onChange={handleChange} required className="w-full mt-1 p-2 border rounded-md" />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Core Job Interest?</label>
              <select name="Interested_in_Core_Job" onChange={handleChange} className="w-full mt-1 p-2 border rounded-md">
                <option>Yes</option><option>No</option><option>Not Sure</option>
              </select>
            </div>
          </div>

          <button type="submit" disabled={loading} className="w-full bg-blue-600 text-white p-3 rounded-lg hover:bg-blue-700 transition font-bold text-lg shadow-md">
            {loading ? "Analyzing..." : "Check Burnout Risk"}
          </button>
        </form>

        {/* ERROR MESSAGE */}
        {error && (
          <div className="mt-6 p-4 bg-red-100 text-red-700 rounded-lg border border-red-200 text-center">
            {error}
          </div>
        )}

        {/* RESULTS DISPLAY */}
        {result && (
          <div className={`mt-8 p-6 rounded-lg text-center border-2 transition-all transform scale-100 ${result.burnout_risk === 1 ? 'bg-red-50 border-red-400' : 'bg-green-50 border-green-400'}`}>
            <h2 className={`text-3xl font-extrabold mb-2 ${result.burnout_risk === 1 ? 'text-red-600' : 'text-green-600'}`}>
              {result.burnout_risk === 1 ? "⚠️ High Burnout Risk Detected" : "✅ You are Safe!"}
            </h2>

            <div className="text-gray-700 text-lg">
              Probability: <span className="font-bold">{result.risk_probability}%</span>
            </div>

            <div className="mt-4 p-4 bg-white rounded shadow-sm text-left">
              <h3 className="font-bold text-gray-800">Recommendation:</h3>
              {result.burnout_risk === 1 ? (
                <ul className="list-disc list-inside text-gray-600 mt-2 space-y-1">
                  <li>Your stress levels are critically high relative to your sleep.</li>
                  <li>Prioritize getting at least 7 hours of sleep tonight.</li>
                  <li>Break your study sessions into smaller chunks (Pomodoro technique).</li>
                </ul>
              ) : (
                <p className="text-gray-600 mt-2">Your current habits are sustainable. Keep maintaining a good balance between study and rest!</p>
              )}
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
